import React, { useState, useEffect } from "react";
import axios from "axios";
import { Line } from "react-chartjs-2";
import { Chart as ChartJS, CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend } from 'chart.js';

ChartJS.register(CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend);

const Reports = () => {
  const [totalIncome, setTotalIncome] = useState(0);
  const [budgetAllocated, setBudgetAllocated] = useState(0);
  const [totalExpense, setTotalExpense] = useState(0);
  const [incomeGraphsData, setIncomeGraphsData] = useState({
    labels: [],
    datasets: [{ label: 'Income', data: [] }]
  });
  const [budgetGraphsData, setBudgetGraphsData] = useState({
    labels: [],
    datasets: [{ label: 'Allocated', data: [] }, { label: 'Remaining', data: [] }]
  });
  const [expenseGraphsData, setExpenseGraphsData] = useState({
    labels: [],
    datasets: [{ label: 'Expense', data: [] }]
  });

  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchReportData = async () => {
      setLoading(true);
      setError(null);
      try {
        const token = localStorage.getItem("token");
        const res = await axios.get("http://localhost:3001/api/reports", {
          headers: { Authorization: `Bearer ${token}` }
        });
        const data = res.data;

        setTotalIncome(data.totalIncome);
        setBudgetAllocated(data.budgetAllocated);
        setTotalExpense(data.totalExpense);
        setIncomeGraphsData(data.incomeGraphs);
        setBudgetGraphsData(data.budgetGraphs);
        setExpenseGraphsData(data.expenseGraphs);

      } catch (err) {
        setError("Error fetching report data. Please try again later.");
        console.error("Error fetching report data:", err);
      } finally {
        setLoading(false);
      }
    };

    fetchReportData();
  }, []);

  const graphOptions = {
    responsive: true,
    plugins: {
      title: { display: true, text: '' }
    },
    scales: {
      x: { beginAtZero: true },
      y: { beginAtZero: true },
    },
  };

  if (loading) {
    return <div>Loading report data...</div>;
  }

  if (error) {
    return <div>{error}</div>;
  }

  return (
    <div>
      <div className="report-summary">
        <div>Total Income: {totalIncome}</div>
        <div>Budget Allocated: {budgetAllocated}</div>
        <div>Budget Remaining: {totalIncome - budgetAllocated}</div>
        <div>Total Expense: {totalExpense}</div>
        <div>Amount Left to Spend: {totalIncome - totalExpense}</div>
      </div>

      <div className="graphs-container">
        <div className="graph-box">
          {incomeGraphsData.labels.length > 0 ? (
            <Line data={incomeGraphsData} options={{ ...graphOptions, plugins: { title: { text: 'Income by Source' } } }} />
          ) : <div>No income data available</div>}
        </div>

        <div className="graph-box">
          {budgetGraphsData.labels.length > 0 ? (
            <Line data={budgetGraphsData} options={{ ...graphOptions, plugins: { title: { text: 'Budget Allocation & Remaining' } } }} />
          ) : <div>No budget data available</div>}
        </div>

        <div className="graph-box">
          {expenseGraphsData.labels.length > 0 ? (
            <Line data={expenseGraphsData} options={{ ...graphOptions, plugins: { title: { text: 'Expense by Category' } } }} />
          ) : <div>No expense data available</div>}
        </div>
      </div>
    </div>
  );
};

export default Reports;
